import { Box , Typography, Grid} from "@material-ui/core";

function HomePage() {
  return (
    <Box>
      <Grid container>
        <Grid item><Box height="500px" bgcolor="green"></Box></Grid>
        <Grid item><Box height="500px" bgcolor="green"></Box></Grid>
      </Grid>
    </Box>
  );
}

export default HomePage;
